import React, {Component} from 'react';

class Location extends Component {
    render() {
        fetch('http://api.openweathermap.org/data/2.5/weather?q=Chicago&APPID=8a5ef08ed5c0d2cb0672425f4f244986'
        , {mode: 'cors'})
            .then(function(response) {
                let x = response.json()
            })
        return (
            x
        );
    }
}

export default Location;
